import { useEffect, useState } from "react"

export default function Card(props) {

    const [torf,toggle]=useState(false);

    useEffect(()=>{
        if(torf)
        {
            document.getElementById(`menu-${props.elem}`).style.display='block'
        }
        else{}
    },[torf])


    return (
        <>

            <div className="btn-group">
                <button onClick={()=>{toggle(prev=>!prev)}} type="button" className="btn btn-danger dropdown-toggle" >
                    Action
                </button>

                <div id={`menu-${props.elem}`} style={{display:'none'}}>
                    <input />
                </div>

            </div>
        </>
    )
}
